var totalUsersCount=0,unregistered=0,totalComplete=!1,unregisteredComplete=!1;$(document).ready(function(){getTotalUsers();getUnregisteredUsers()});function getTotalUsers(){var a=new SearchUsers;a.setAccountActive(!0);a.setAccountPending(!0);a.setMetricsOnly(!0);$.when(a.fetch()).then(function(a){totalUsersCount=parseInt(a.total_items);totalComplete=!0;readyCheck()})}
function getUnregisteredUsers(){var a=new SearchUsers;a.setAccountActive(!1);a.setAccountPending(!0);a.setMetricsOnly(!0);$.when(a.fetch()).then(function(a){unregistered=parseInt(a.total_items);unregisteredComplete=!0;readyCheck()})}function readyCheck(){if(1==totalComplete&&1==unregisteredComplete){var a=Math.round(100-100/totalUsersCount*unregistered);$("#user-registration-bar").css("width",a+"%").attr("aria-valuenow",a).html(a+"%")}};
